import React from 'react';
import './Form.css';


class Form  extends React.Component {
constructor(){
  super();
  this.state = {
    signInEmail: '',
    signInPassword: ''
  }
}

onEmailChange = (event) => {
  this.setState({signInEmail: event.target.value})
}

onPasswordChange = (event) => {
  this.setState({onPasswordChange: event.target.value})
}

onSumbitSignIn = () => {
  fetch('http://localhost:3001/signin',{
    method: 'post',
    header: {'Content-Type': 'application/json'},
    body: JSON.stringify({
      email: this.state.signInEmail,
      password: this.state.signInPassword
    })
  })
}


render(){
  return (
    <div className="flex flex-wrap justify-between items-center mt5 ph3 f1-ns tc tc-ns bg-dark-blue mh6 pv3 br4" >

      <div className="tl ml5">
        <h1 className="f1 fw4 ttu white tracked-tight mv0">
         Innovate <br></br>
         y sobrevive
         <br></br>
         al cambio
        </h1>
        <p className="f5 fw1 white tracked-tight">
         Tienes las ideas y  proyectos en mente, nosotros <br></br>lo materializamos y lo volvemos realidad.
        </p>
      </div>

        <form className="measure center  pa4 white ">
            <fieldset id="sign_up" className="ba b--transparent ph0 mh0 mw6 center">
              <legend className="f2 ttu fw6 ">Tus Ideas...</legend>
              <div className="mt3">
                <label className="db fw6 lh-copy f6" for="email-address">Email</label>
                <input
                  onChange = {this.onEmailChange}
                  className="br4 pa0 input-reset ba bg-transparent hover-bg-black hover-white w-100"
                  type="email"
                  name="email-address"
                  id="email-address"
                  />
              </div>
              <div className="mv3">
                <label className="db fw6 lh-copy f6" for="password">Password</label>
                <input
                  onChange = {this.onPasswordChange}
                  className="br4 pa2 input-reset ba bg-transparent hover-bg-black hover-white w-100"
                  type="password"
                  name="password"
                  id="password"
                  />
              </div>

            </fieldset>
            <div className="">
              <input
                onClick = {this.onSumbitSignIn}
                className=" f3 tracked-tight dib bg-animate hover-bg-purple hover-white no-underline pv3 ph5 br4 ba b--blue blue bg-transparent"
                type="submit"
                value="LA MATERIALIZAMOS"/>
            </div>
            </form>
  </div>

  );


}
}

export default Form;
